# Default values for cwd-ldap.
# This is a YAML-formatted file.
# Declare variables to be passed into your templates.

replicaCount: 1

image:
  repository: iad.ocir.io/cwdinfradev/cwd/cwd-ldap
  pullPolicy: IfNotPresent
  # Overrides the image tag whose default is the chart version.
  tag: "17.0.0"
  busyboxImage: iad.ocir.io/cwdinfradev/cwd/busybox
  busyboxVersion: "1.32"

busybox:
  image: "iad.ocir.io/cwdinfradev/cwd/busybox:1.32"

imagePullSecrets:
  - name: ocirsecret
nameOverride: ""
fullnameOverride: ""

podAnnotations: {}
podExtraLabels:
  common-logging-flow: enabled
podExtraAnnotations:
  vault.security.banzaicloud.io/vault-role: "cwd-production_apps_cloudwatchdog"
podSecurityContext: {}
# fsGroup: 2000

securityContext: {}
  # capabilities:
  #   drop:
  #   - ALL
  # readOnlyRootFilesystem: true
  # runAsNonRoot: true
# runAsUser: 1000

container:
  port: 9000
service:
  type: ClusterIP
  port: 9000
cwd:
  ldap:
    LdapService:
      providerUrl: ldap://ldap.oracle.com:389
      searchBase: cn=CWD,cn=groups,dc=oracle,dc=com
      attributeName: uniquemember
      searchFilterKey: cn=
      searchResultPattern: cn=(.*),l=.*
    LdapConsumer:
      periodMs: 600000
      # groupName work with LdapService.searchFilterKey, split with ,
      groups: admin,ops,executive
    OceanService:
      clientId: C433AEAB51066708E0530201FD0AF8E1
      secret: 8d19bc2a-cbef-4e90-8228-cf8ed74165dd
      tenancyId: 8723F92A522DB107E0530424000A6404
      headerClientId: X-Ocean-Client-Id
      headerSecret: X-Ocean-Secret
      headerTenancyId: X-Ocean-Tenancy-Id
      orgId: 8723F92A522EB107E0530424000A6404
      urlCreateIncident: https://oceanclient.ocs.oraclecloud.com/api/v1/orgs/{orgId}/incidents
      urlIncidentAttachment: https://oceanclient.ocs.oraclecloud.com/api/v1/orgs/{orgId}/incidents/{incidentId}/attachment
      urlCreateIncidentType: IncidentTo
      incidentTags: project:CWD
      incidentTagEnv: environment
      incidentTagSvc: service
      urlCreateIncidentStatus: Open
      urlCreateIncidentResponseHeader: X-Ocean-Incident-Id
    OceanConsumer:
      periodMs: 300000
    db:
      dbName: prodcwd_high
      username: watchdog
      password: Welcome_1234_1234
      secretName: wallet
      walletFileName: wallet.zip
      walletZipContentsBase64:  

ingress:
  enabled: false
  annotations: {}
    # kubernetes.io/ingress.class: nginx
  # kubernetes.io/tls-acme: "true"
  hosts:
    - host: chart-example.local
      paths: []
  tls: []
  #  - secretName: chart-example-tls
  #    hosts:
  #      - chart-example.local

resources: {}
  # We usually recommend not to specify default resources and to leave this as a conscious
  # choice for the user. This also increases chances charts run on environments with little
  # resources, such as Minikube. If you do want to specify resources, uncomment the following
  # lines, adjust them as necessary, and remove the curly braces after 'resources:'.
  # limits:
  #   cpu: 100m
  #   memory: 128Mi
  # requests:
  #   cpu: 100m
#   memory: 128Mi

autoscaling:
  enabled: false
  minReplicas: 1
  maxReplicas: 100
  targetCPUUtilizationPercentage: 80
  # targetMemoryUtilizationPercentage: 80

nodeSelector: {}

tolerations: []

affinity: {}
